/*Table structure for table `classroom` */

DROP TABLE IF EXISTS `classroom`;

CREATE TABLE `classroom` (
  `classroomId` varchar(45) NOT NULL,
  `campus` varchar(45) DEFAULT NULL COMMENT '所在校区',
  `building` varchar(45) DEFAULT NULL COMMENT '所在楼房',
  `floor` int(11) DEFAULT NULL COMMENT '楼层',
  `classroomNum` varchar(45) DEFAULT NULL COMMENT '门牌号',
  `classroomName` varchar(45) DEFAULT NULL COMMENT '教室名称',
  `classroomType` varchar(45) DEFAULT NULL COMMENT '教室类型',
  `classroomCapacity` int(11) DEFAULT NULL COMMENT '教室容量:人',
  `classroomArea` float DEFAULT NULL COMMENT '使用面积',
  `classroomStatus` varchar(45) DEFAULT NULL COMMENT '使用状态:使用/停用',
  `classroomUnit` varchar(45) DEFAULT NULL COMMENT '使用单位',
  `createMan` varchar(45) DEFAULT NULL,
  `createDate` datetime DEFAULT NULL,
  `updateMan` varchar(45) DEFAULT NULL,
  `updateDate` datetime DEFAULT NULL,
  `minCapacityRate` float DEFAULT NULL COMMENT '教室最小容积率',
  PRIMARY KEY (`classroomId`),
  UNIQUE KEY `classroom_unique` (`campus`,`building`,`floor`,`classroomNum`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='教室';

