/*Table structure for table `college` */

DROP TABLE IF EXISTS `college`;

CREATE TABLE `college` (
  `collegeId` varchar(45) NOT NULL,
  `collegeName` varchar(45) DEFAULT NULL COMMENT '学院名称',
  `collegeDescription` varchar(200) DEFAULT NULL COMMENT '学院简介',
  `collegeContent` text COMMENT '学院介绍',
  `collegeSort` int(11) DEFAULT NULL COMMENT '学院顺序',
  `parentId` varchar(45) DEFAULT NULL COMMENT '所属学院',
  `createMan` varchar(45) DEFAULT NULL,
  `createDate` datetime DEFAULT NULL,
  `updateMan` varchar(45) DEFAULT NULL,
