/*Table structure for table `course` */

DROP TABLE IF EXISTS `course`;

CREATE TABLE `course` (
  `courseId` varchar(45) NOT NULL,
  `courseCode` varchar(45) DEFAULT NULL COMMENT '课程代码',
  `chineseName` varchar(45) DEFAULT NULL COMMENT '中文名称',
  `englishName` varchar(45) DEFAULT NULL COMMENT '英文名称',
  `assumeUnit` varchar(45) DEFAULT NULL COMMENT '承担单位',
  `courseCategory_3` varchar(45) DEFAULT NULL COMMENT '课程类别三（课程课、实践课）',
  `courseCategory_4` varchar(45) DEFAULT NULL COMMENT '课程类别四（普通课、上机课、实验课、实训课、体育课、外语课）',
  `courseCategory_5` varchar(45) DEFAULT NULL COMMENT '课程类别五（自然科学类、计算机科学类、国际化类）',
  `totalCredit` varchar(45) DEFAULT NULL COMMENT '总学分',
  `theoreticalCredit` varchar(45) DEFAULT NULL COMMENT '理论学分',
  `practiceCredit` varchar(45) DEFAULT NULL COMMENT '实践学分',
  `teachingTime` varchar(45) DEFAULT NULL COMMENT '讲授学时',
  `experimentalTime` varchar(45) DEFAULT NULL COMMENT '实验学时',
  `machineTime` varchar(45) DEFAULT NULL COMMENT '上机学时',
  `otherTime` varchar(45) DEFAULT NULL COMMENT '其他学时',
  `totalTime` varchar(45) DEFAULT NULL COMMENT '总学时',
  `courseStatus` varchar(45) DEFAULT NULL COMMENT '课程状态（启用、停用）',
  `refuseReason` varchar(100) DEFAULT NULL COMMENT '未通过原因',
  `checkStatus` varchar(45) DEFAULT NULL COMMENT '审核状态（4个状态）',
  `checkType` varchar(45) DEFAULT NULL COMMENT '审核类别（新增、修改、删除）',
  `relationId` varchar(45) DEFAULT NULL COMMENT '关联Id',
  `scheduleTime` varchar(45) DEFAULT NULL COMMENT '排课节次时间',
  `nonscheduleTime` varchar(45) DEFAULT NULL COMMENT '不排课节次时间',
  `mainteacherid` varchar(45) DEFAULT NULL COMMENT '负责教师',
  `coursebookid` varchar(45) DEFAULT NULL COMMENT '教材(对应教材表)',
  `sparecoursebookid` varchar(45) DEFAULT NULL COMMENT '备用教材(对应教材表)',
  `issparecourse` varchar(45) DEFAULT NULL COMMENT '1是/0否使用备用教材',
  PRIMARY KEY (`courseId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

