/*Table structure for table `educateplane` */

DROP TABLE IF EXISTS `educateplane`;

CREATE TABLE `educateplane` (
  `ep_id` varchar(45) NOT NULL,
  `ep_grade` varchar(45) DEFAULT NULL COMMENT '年级',
  `ep_college` varchar(45) DEFAULT NULL COMMENT '学院',
  `ep_major` varchar(45) DEFAULT NULL COMMENT '专业',
  `ep_term` varchar(45) DEFAULT NULL COMMENT '学期',
  `ep_courseid` varchar(45) DEFAULT NULL COMMENT '课程id',
  `courseCategory_1` varchar(45) DEFAULT NULL COMMENT '课程类别一',
  `ep_terrace` varchar(45) DEFAULT NULL COMMENT '培养平台',
  `ep_checkway` varchar(45) DEFAULT NULL COMMENT '考核方式',
  `ep_courseterm` varchar(45) DEFAULT NULL COMMENT '(删)开课学期',
  `ep_week` varchar(45) DEFAULT NULL COMMENT '周时',
  `ep_note` varchar(45) DEFAULT NULL COMMENT '备注',
  `ep_checkStatus` varchar(45) DEFAULT NULL COMMENT '审核状态',
  `ep_checkType` varchar(45) DEFAULT NULL COMMENT '审核类型',
  `ep_refuseReason` varchar(45) DEFAULT NULL COMMENT '拒绝理由',
  `ep_relationId` varchar(45) DEFAULT NULL COMMENT '关联ID',
  `ep_isDelete` varchar(45) DEFAULT NULL COMMENT '是否删除',
  `ep_setman` varchar(45) DEFAULT NULL COMMENT '设置人',
  `ep_settime` datetime DEFAULT NULL COMMENT '设置时间',
  `ep_isset` varchar(10) DEFAULT NULL COMMENT '给开课课程为 1',
  PRIMARY KEY (`ep_id`)
