/*Table structure for table `major` */

DROP TABLE IF EXISTS `major`;

CREATE TABLE `major` (
  `majorId` varchar(45) NOT NULL,
  `majorCollege` varchar(45) DEFAULT NULL COMMENT '所属学院',
  `internationalNum` int(11) DEFAULT NULL COMMENT '国标专业个数',
  `internationalCode` varchar(45) DEFAULT NULL COMMENT '国际专业代码',
  `majorCode` varchar(45) DEFAULT NULL COMMENT '专业代码',
  `majorName` varchar(45) DEFAULT NULL COMMENT '专业名称',
  `subject` varchar(45) DEFAULT NULL COMMENT '所属学科',
  `level` varchar(45) DEFAULT NULL COMMENT '培养层次',
  `length` int(11) DEFAULT NULL COMMENT '学制',
  `settingYear` int(11) DEFAULT NULL COMMENT '设置年份',
  `majorStatus` varchar(45) DEFAULT NULL COMMENT '专业状态:启用/停用',
  `checkStatus` varchar(45) DEFAULT NULL COMMENT '审核状态:待审核/已通过/未通过',
  `checkType` varchar(45) DEFAULT NULL COMMENT '审核类别:新增/修改/删除/停启用',
  `checkMan` varchar(45) DEFAULT NULL COMMENT '审核人',
  `checkDate` datetime DEFAULT NULL COMMENT '审核时间',
  `refuseReason` varchar(100) DEFAULT NULL COMMENT '未通过原因',
  `relationId` varchar(45) DEFAULT NULL COMMENT '关联ID,修改时使用,关联修改之前的记录ID',
  `isDelete` varchar(5) DEFAULT NULL COMMENT '是否删除：是/否',
  `createMan` varchar(45) DEFAULT NULL,
  `createDate` datetime DEFAULT NULL,
  `updateMan` varchar(45) DEFAULT NULL,
  `updateDate` datetime DEFAULT NULL,
  `scheduleTime` varchar(300) DEFAULT NULL COMMENT '该专业学生空余时间',
  `trainingobjects` varchar(50) DEFAULT NULL COMMENT '培养对象',
  `introduction` varchar(500) DEFAULT NULL COMMENT '简介',
  PRIMARY KEY (`majorId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='专业';

