/*Table structure for table `majorrecord` */

DROP TABLE IF EXISTS `majorrecord`;

CREATE TABLE `majorrecord` (
  `id` varchar(45) NOT NULL COMMENT 'id',
  `majorId` varchar(45) DEFAULT NULL COMMENT '操作的专业id',
  `time` datetime DEFAULT NULL COMMENT '操作时间',
  `type` varchar(45) DEFAULT NULL COMMENT '操作类型',
  `result` varchar(45) DEFAULT NULL COMMENT '审核状态',
  `before` varchar(200) DEFAULT NULL COMMENT '修改之前的内容',
  `after` varchar(200) DEFAULT NULL COMMENT '修改之后的内容',
  PRIMARY KEY (`id`)
