/*Table structure for table `majorterracecourse` */

DROP TABLE IF EXISTS `majorterracecourse`;

CREATE TABLE `majorterracecourse` (
  `mtc_id` varchar(45) NOT NULL,
  `majorId` varchar(45) DEFAULT NULL COMMENT '专业ID',
  `terraceId` varchar(45) DEFAULT NULL COMMENT '平台id',
  `courseId` varchar(45) DEFAULT NULL COMMENT '课程id',
  `mtc_grade` varchar(45) DEFAULT NULL COMMENT '年级',
  `mtc_checkWay` varchar(45) DEFAULT NULL COMMENT '(删)考核方式',
  `mtc_courseTerm` varchar(45) DEFAULT NULL COMMENT '课程学期',
  `mtc_majorWay` varchar(45) DEFAULT NULL COMMENT '主修/辅修',
  `mtc_note` varchar(45) DEFAULT NULL COMMENT '备注',
  `mtc_checkStatus` varchar(45) DEFAULT NULL COMMENT '审核状态:待审核/已通过/未通过',
  `mtc_checkType` varchar(45) DEFAULT NULL COMMENT '审核类别:新增/修改/删除/停启用',
  `mtc_refuseReason` varchar(45) DEFAULT NULL COMMENT '拒绝原因',
  `mtc_relationId` varchar(45) DEFAULT NULL COMMENT '关联ID',
  `mtc_isDelete` varchar(45) DEFAULT NULL COMMENT '是否删除',
  `mtc_setman` varchar(45) DEFAULT NULL COMMENT '设置人',
  `mtc_settime` datetime DEFAULT NULL COMMENT '设置时间',
  PRIMARY KEY (`mtc_id`)
