/*Table structure for table `spareclassroom` */

DROP TABLE IF EXISTS `spareclassroom`;

CREATE TABLE `spareclassroom` (
  `scId` varchar(45) NOT NULL COMMENT '空教室设置',
  `week` varchar(10) DEFAULT NULL COMMENT '第几周',
  `weekday` varchar(45) DEFAULT NULL COMMENT '星期数',
  `classes` varchar(10) DEFAULT NULL COMMENT '第几节课',
  `classtype` varchar(45) DEFAULT NULL COMMENT '教室类型',
  `num` varchar(45) DEFAULT NULL COMMENT '教室数量',
  PRIMARY KEY (`scId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `spareclassroom` */

