/*Table structure for table `stuchoosecourse` */

DROP TABLE IF EXISTS `stuchoosecourse`;

CREATE TABLE `stuchoosecourse` (
  `scc` varchar(45) NOT NULL,
  `studentId` varchar(45) DEFAULT NULL COMMENT '学生id',
  `majorId` varchar(45) DEFAULT NULL COMMENT '課程对应专业id',
  `courseId` varchar(45) DEFAULT NULL COMMENT '课程id',
  `tc_id` varchar(45) DEFAULT NULL COMMENT 'teachtask',
  `terraceId` varchar(45) DEFAULT NULL COMMENT '平台id',
  `class` varchar(45) DEFAULT NULL COMMENT '所在班级',
  `studentNum` varchar(45) DEFAULT NULL COMMENT '学号',
  `teacherName` varchar(45) DEFAULT NULL COMMENT '班级教师',
  `courseCode` varchar(45) DEFAULT NULL COMMENT '课程代码',
  `chineseName` varchar(45) DEFAULT NULL COMMENT '课程中文名称',
  `term` varchar(45) DEFAULT NULL COMMENT '当前学期',
  `iscomfirm` varchar(10) DEFAULT NULL COMMENT '1确认选择 0调剂 2调剂选课',
  `istiaojicomfirm` varchar(45) DEFAULT NULL COMMENT '1调剂确认 2可以进入调剂平台',
  `isautotiaoji` int(10) DEFAULT NULL COMMENT '1是0否',
  `scc_status` varchar(45) DEFAULT NULL COMMENT '退课申请、退课通过、退课拒绝',
  `Areason` varchar(45) DEFAULT NULL COMMENT '申请理由',
  `Rreason` varchar(45) DEFAULT NULL COMMENT '拒绝理由',
  `pass` varchar(45) DEFAULT NULL COMMENT '已通过 未通过 选修中',
  PRIMARY KEY (`scc`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

