/*Table structure for table `student` */

DROP TABLE IF EXISTS `student`;

CREATE TABLE `student` (
  `studentId` varchar(45) NOT NULL,
  `studentNum` varchar(45) DEFAULT NULL COMMENT '学号',
  `studentName` varchar(45) DEFAULT NULL COMMENT '姓名',
  `namePinYin` varchar(45) DEFAULT NULL COMMENT '姓名全拼',
  `usedName` varchar(45) DEFAULT NULL COMMENT '曾用名',
  `studentIcon` varchar(45) DEFAULT NULL COMMENT '照片',
  `studentIDCard` varchar(45) DEFAULT NULL COMMENT '身份证号码',
  `studentGender` varchar(5) DEFAULT NULL COMMENT '性别:男/女',
  `studentBirthday` date DEFAULT NULL COMMENT '出生日期',
  `studentNation` varchar(45) DEFAULT NULL COMMENT '民族',
  `studentPolitics` varchar(45) DEFAULT NULL COMMENT '政治面貌',
  `studentPhone` varchar(15) DEFAULT NULL COMMENT '手机',
  `studentEmail` varchar(45) DEFAULT NULL COMMENT '邮箱',
  `linkMan` varchar(45) DEFAULT NULL COMMENT '其他联系人',
  `linkManPhone` varchar(45) DEFAULT NULL COMMENT '联系人电话',
  `linkManaddress` varchar(45) DEFAULT NULL COMMENT '联系地址',
  `linkManPostcode` varchar(45) DEFAULT NULL COMMENT '联系人邮编',
  `examNumber` varchar(45) DEFAULT NULL COMMENT '考号',
  `province` varchar(45) DEFAULT NULL COMMENT '高考所在省',
  `highSchool` varchar(45) DEFAULT NULL COMMENT '毕业中学',
  `entranceDate` date DEFAULT NULL COMMENT '入学日期',
  `studentGrade` varchar(45) DEFAULT NULL COMMENT '年级',
  `studentCollege` varchar(45) DEFAULT NULL COMMENT '学院',
  `studentMajor` varchar(45) DEFAULT NULL COMMENT '专业',
  `otherMajor` varchar(45) DEFAULT NULL COMMENT '辅修',
  `studentClass` varchar(45) DEFAULT NULL COMMENT '班级',
  `studentLevel` varchar(45) DEFAULT NULL COMMENT '培养层次:专科/本科',
  `studentLength` varchar(11) DEFAULT NULL COMMENT '学制:3/4',
  `studentForm` varchar(45) DEFAULT NULL COMMENT '学习形式:普通全日制',
  `studentSchoolAddress` varchar(45) DEFAULT NULL COMMENT '校区',
  `isDelete` varchar(5) DEFAULT NULL COMMENT '是否删除:是/否',
  `cantiaoji` varchar(45) DEFAULT NULL COMMENT '可以调剂',
  `tiaojiterm` varchar(45) DEFAULT NULL COMMENT '调剂学期',
  PRIMARY KEY (`studentId`),
  UNIQUE KEY `studentnum_unique` (`studentNum`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='学生表';

