/*Table structure for table `stumajorrecord` */

DROP TABLE IF EXISTS `stumajorrecord`;

CREATE TABLE `stumajorrecord` (
  `id` varchar(45) NOT NULL COMMENT 'id',
  `studentId` varchar(45) DEFAULT NULL COMMENT '学生id',
  `type` varchar(45) DEFAULT NULL COMMENT '操作类型：选修/辅修',
  `beforeMajor` varchar(45) DEFAULT NULL COMMENT '更换前专业',
  `afterMajor` varchar(45) DEFAULT NULL COMMENT '更换后专业',
  `otherMajor` varchar(45) DEFAULT NULL COMMENT '辅修',
  `time` datetime DEFAULT NULL COMMENT '操作时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

