/*Table structure for table `teacher` */

DROP TABLE IF EXISTS `teacher`;

CREATE TABLE `teacher` (
  `teacherId` varchar(45) NOT NULL,
  `teacherNumber` varchar(45) DEFAULT NULL COMMENT '工号',
  `teacherName` varchar(45) DEFAULT NULL COMMENT '教师姓名',
  `teacherIcon` varchar(45) DEFAULT NULL COMMENT '照片',
  `teacherGender` varchar(5) DEFAULT NULL COMMENT '性别:下拉框:男/女',
  `nation` varchar(45) DEFAULT NULL COMMENT '民族',
  `politics` varchar(45) DEFAULT NULL COMMENT '政治面貌,下拉框:群众,共青团员,中共党员,其他',
  `politicsDate` date DEFAULT NULL COMMENT '加入时间',
  `IDCard` varchar(45) DEFAULT NULL COMMENT '身份证',
  `birthday` date DEFAULT NULL COMMENT '出生日期',
  `schoolDate` date DEFAULT NULL COMMENT '来校日期',
  `department` varchar(45) DEFAULT NULL COMMENT '所属部门',
  `administrative` varchar(45) DEFAULT NULL COMMENT '行政职务',
  `teachUnit` varchar(45) DEFAULT NULL COMMENT '任教单位',
  `duty` varchar(45) DEFAULT NULL COMMENT '专业技术职务',
  `dutyDate` date DEFAULT NULL COMMENT '专业技术职务任职资格时间',
  `dutyLevel` varchar(45) DEFAULT NULL COMMENT '专业技术职务等级,下拉框:高级/中级/低级',
  `education` varchar(45) DEFAULT NULL COMMENT '学历',
  `educationDate` varchar(45) DEFAULT NULL COMMENT '学历学习时间:yyyy/MM-yyyy/MM',
  `educationMajor` varchar(45) DEFAULT NULL COMMENT '学历专业',
  `educationSchool` varchar(45) DEFAULT NULL COMMENT '学历获取机构',
  `educationStructure` varchar(45) DEFAULT NULL COMMENT '学缘结构',
  `degree` varchar(45) DEFAULT NULL COMMENT '学位',
  `degreeDate` date DEFAULT NULL COMMENT '学位学习时间：yyyy/MM-yyyy/MM',
  `degreeMajor` varchar(45) DEFAULT NULL COMMENT '学位所学专业',
  `degreeSchool` varchar(45) DEFAULT NULL COMMENT '学位获取机构',
  `certificate` varchar(45) DEFAULT NULL COMMENT '高等教育资格证 ',
  `certificateDate` date DEFAULT NULL COMMENT '高等教育资格证获得时间',
  `teachDate` date DEFAULT NULL COMMENT '从教时间',
  `teachCollege` varchar(45) DEFAULT NULL COMMENT '任教学院',
  `teachMajor` varchar(45) DEFAULT NULL COMMENT '任教专业',
  `teachSection` varchar(45) DEFAULT NULL COMMENT '任教学段',
  `teachStatus` varchar(45) DEFAULT NULL COMMENT '任课状况',
  `teachArea` varchar(45) DEFAULT NULL COMMENT '从事领域',
  `isCompile` varchar(45) DEFAULT NULL COMMENT '是否事业编制',
  `contract` varchar(45) DEFAULT NULL COMMENT '签订合同情况',
  `fiveOne` varchar(45) DEFAULT NULL COMMENT '五险一金',
  `doubleTeacher` varchar(45) DEFAULT NULL COMMENT '是否双师',
  `certificateLevel` varchar(45) DEFAULT NULL COMMENT '职业资格证书等级',
  `bBackground` varchar(45) DEFAULT NULL COMMENT '是否有行业背景',
  `pBackground` varchar(45) DEFAULT NULL COMMENT '是否有工程背景',
  `employ` varchar(45) DEFAULT NULL COMMENT '是否外聘',
  `employUnit` varchar(45) DEFAULT NULL COMMENT '外聘工作单位',
  `employDate` date DEFAULT NULL COMMENT '外聘日期',
  `employSource` varchar(45) DEFAULT NULL COMMENT '外聘来源',
  `native` varchar(45) DEFAULT NULL COMMENT '户籍所在地',
  `address` varchar(45) DEFAULT NULL COMMENT '家庭地址',
  `phone` varchar(45) DEFAULT NULL COMMENT '联系电话',
  `email` varchar(45) DEFAULT NULL COMMENT '邮箱',
  `onGuard` varchar(45) DEFAULT NULL COMMENT '是否在岗',
  `status` varchar(45) DEFAULT NULL COMMENT '状态:在职/离职',
  `isDelete` varchar(45) DEFAULT NULL COMMENT '是否删除',
  `spareTime` varchar(45) DEFAULT NULL COMMENT '每天空余时间/课时',
  `mostClasses` varchar(45) DEFAULT NULL COMMENT '每天最多课程/节',
  `scheduleTime` varchar(300) DEFAULT NULL COMMENT '排课节次时间',
  `nonscheduleTime` varchar(300) DEFAULT NULL COMMENT '不排课节次时间',
  PRIMARY KEY (`teacherId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='教师表';

