/*Table structure for table `teachtask` */

DROP TABLE IF EXISTS `teachtask`;

CREATE TABLE `teachtask` (
  `tc_id` varchar(45) NOT NULL,
  `tc_courseid` varchar(45) DEFAULT NULL COMMENT '课程号id',
  `tc_mainteacherid` varchar(45) DEFAULT NULL COMMENT '负责教师id',
  `tc_class` varchar(45) DEFAULT NULL COMMENT '所分班级',
  `tc_classteacherid` varchar(45) DEFAULT NULL COMMENT '班级教师id',
  `tc_studentnum` varchar(45) DEFAULT NULL COMMENT '开课人数',
  `tc_numrange` varchar(45) DEFAULT NULL COMMENT '人数范围',
  `tc_teachway` varchar(45) DEFAULT NULL COMMENT '授课方式，对应教室类型',
  `tc_weekhours` int(45) DEFAULT NULL COMMENT '周学时',
  `tc_thweek_start` int(45) DEFAULT NULL COMMENT '设置开始周时（1,代表第一周）',
  `tc_thweek_end` int(45) DEFAULT NULL COMMENT '设置结束周时（10，代表第10周）',
  `tc_teachodd` varchar(45) DEFAULT NULL COMMENT '单双周3个（无、单周、双周）',
  `tc_teachmore` varchar(45) DEFAULT NULL COMMENT '是否有先修课程',
  `tc_checkType` varchar(45) DEFAULT NULL COMMENT '审核类型3个（新增、删除、修改）',
  `tc_checkStatus` varchar(45) DEFAULT NULL COMMENT '审核状态3个（待审核、已通过、未通过）',
  `tc_refuseReason` varchar(45) DEFAULT NULL COMMENT '拒绝理由',
  `tc_relationId` varchar(45) DEFAULT NULL COMMENT '关联ID',
  `tc_isDelete` varchar(45) DEFAULT NULL COMMENT '是否删除',
  `tc_setman` varchar(45) DEFAULT NULL COMMENT '设置人',
  `tc_settime` datetime DEFAULT NULL COMMENT '设置时间',
  `tc_chooseway` varchar(45) DEFAULT NULL COMMENT '(专业专属、不分专业)tcmajor表',
  `tc_semester` varchar(45) DEFAULT NULL COMMENT '学期',
  `tc_grade` varchar(45) DEFAULT NULL COMMENT '(删)年级',
  `tc_majorId` varchar(45) DEFAULT NULL COMMENT '(删)专业id(id,null)',
  `tc_teachweek` varchar(45) DEFAULT NULL COMMENT '(删)授课周时（几至几）',
  PRIMARY KEY (`tc_id`)
