/* Function  structure for function  `getMenuNameById` */

/*!50003 DROP FUNCTION IF EXISTS `getMenuNameById` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`neunb`@`%` FUNCTION `getMenuNameById`(id VARCHAR(50)) RETURNS varchar(50) CHARSET utf8
BEGIN
	DECLARE result VARCHAR(50);
	SELECT `menuName` INTO result FROM menu WHERE `menuId`= id;
	RETURN result;
    END */$$
DELIMITER ;

/* Function  structure for function  `getRoleIdByName` */

/*!50003 DROP FUNCTION IF EXISTS `getRoleIdByName` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`neunb`@`%` FUNCTION `getRoleIdByName`(rName VARCHAR(50)) RETURNS varchar(50) CHARSET utf8
BEGIN
	DECLARE result VARCHAR(50);
	SELECT `roleId` INTO result FROM role WHERE `roleName`= rName;
	RETURN result;
END */$$
DELIMITER ;

/* Procedure structure for procedure `forinsert` */

/*!50003 DROP PROCEDURE IF EXISTS  `forinsert` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`neunb`@`%` PROCEDURE `forinsert`()
BEGIN
	declare i int;
	set i=1;
	while i<=20 do
		insert into message(messageId,messageTitle,messageContent,messageDate,isRead,receiverId,isDelete) 
			values(uuid(),'消息标题','消息内容消息内容消息内容消息内容',now(),'否','fca3b7d9-0921-11e7-8be9-00ac2794c53f','否');
		set i=i+1;
	end while;
END */$$
DELIMITER ;

