/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`neunb`@`%` SQL SECURITY DEFINER VIEW `bookdistribution_info` AS select `bookdistribution`.`distributionId` AS `distributionId`,`bookdistribution`.`className` AS `className`,`bookdistribution`.`bookid` AS `bookid`,`bookdistribution`.`booktotalnum` AS `booktotalnum`,`bookdistribution`.`is_giveout` AS `is_giveout`,`bookdistribution`.`semester` AS `semester`,`bookdistribution`.`is_now` AS `is_now`,`teachingmaterials`.`tmId` AS `tmId`,`teachingmaterials`.`name` AS `name`,`teachingmaterials`.`press` AS `press`,`teachingmaterials`.`edition` AS `edition`,`teachingmaterials`.`booknumber` AS `booknumber`,`teachingmaterials`.`price` AS `price`,`class`.`collegeName` AS `collegeName`,`class`.`majorName` AS `majorName`,`class`.`gradeName` AS `gradeName` from ((`bookdistribution` left join `class` on((`bookdistribution`.`className` = `class`.`className`))) left join `teachingmaterials` on((`bookdistribution`.`bookid` = `teachingmaterials`.`tmId`))) */;

